import React from "react";

const BinanceHome = () => {
  return (
    <div style={{ height: "100vh", width: "100%" }}>
      <div style={{ height: "15vh", width: "100%", background: "black" }}></div>
      <div
        style={{
          height: "85vh",
          width: "100%",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div
          style={{
            height: "95%",
            width: "950%",
            background: "gray",
            display: "flex",
            flexDirection: "column",
            justifyContent: "space-around",
            alignItems: "center",
          }}
        >
          <div
            style={{
              height: "100%",
              width: "80%",
              background: "yellow",
              overflowY: "scroll",
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
              gap: 10,
            }}
          >
            <div style={{ height: 300, width: "70%", background: "red" }}>
              div_1
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default BinanceHome;
